var MGVideoRCTManager = NativeModules.MGVideoRCTManager;


class MGVideoIOS extends Component
{
	render() {
		MGVideoRCTManager.setUri(this.props.videoPath);
	    return <MyMGVideoIOS {...this.props} />;
	  }
}

MGVideoIOS.propTypes = {
};

var MyMGVideoIOS = requireNativeComponent('MGVideoRCT', MGVideoIOS);

module.exports = MGVideoIOS;